import { RoughNotation, RoughNotationGroup } from "react-rough-notation";

function App() {
  return (
    <div>
      <div className="flex w-screen h-screen items-center">
        <div className="text-center w-full text-4xl">
          You know how music is often classified into solid categories?
          <RoughNotation type="underline" show={state.show}>
            Hello RoughNotation
          </RoughNotation>
        </div>
      </div>
    </div>
  );
}

export default App;
